--	=================
--	HANDLE STAT-TYPES
--	=================

---	Returns the appropriate statType for statName
---@param statName string
---@return string statType
function HandleStatType(statName)
	if not ValidString(statName) then return end

	local statType = Osi.NRD_StatGetType(statName) or ""

	--	SKILLDATA
	--	=========
	if statType == "SkillData" then
		for splitString in string.gmatch(statName, "[^_]+") do --	Underscore splits string.
			for _, subStatType in pairs(SkillandStatusData["SkillData"]) do -- Iterate over SkillData sub-categories.
				if splitString == subStatType then -- if string is a sub-category of SkillData.
					return splitString	--	return subcategory of SkillData.
				end
			end
		end

	--	STATUSDATA
	--	==========
	elseif statType == "StatusData" then
		local status = Ext.GetStat(statName)	--	fetch stat entry.
		local statusType = "Status_" .. status.StatusType	-- get status type and concatenate.
		return statusType	-- return subcategory of StatusData
	else

	--	EVERYTHING ESLE
	--	===============
		return statType
	end
end

--	================
--	ENUM TRANSFORMER
--	================

--	Since Ext.EnumIndexToLabel() and Ext.EnumLabelToIndex() don't seem to work.

---	Converts Enumeration Index and Labels
function EnumTransformer(mode, enumerationTypeName, argument)
	for index, label in pairs(References.Enumerations[enumerationTypeName]) do
		if mode == "Index2Label" and argument == index then
			return label
		elseif mode == "Label2Index" and argument == label then
			return index
		end
	end
end
